import React, { Fragment } from 'react';
import styled, { createGlobalStyle } from 'styled-components';

const App = () => {
  <Fragment>
    <GlobalStyle/>
    <Container>App</Container>;
  </Fragment>
};

export default App;

const GlobalStyle = createGlobalStyle`
  body {
    background-color: black;
    margin: 0;
    padding: 0;
  }
`;

const Container = styled.div`
  width: 100%;
  height: 100%;
`;
